--
-- Create view `view_problem_list`
--
CREATE
DEFINER = 'root'@'localhost'
SQL SECURITY INVOKER
VIEW view_problem_list
AS
WITH `commentcounts`
AS
(SELECT
      `p`.`ProblemId` AS `comment_problem_id`,
      COUNT(`c`.`CommentId`) AS `comment_count`
    FROM ((`problem` `p`
      JOIN `problem_account` `pa`
        ON ((`p`.`ProblemId` = `pa`.`ProblemId`)))
      LEFT JOIN `comment` `c`
        ON ((`pa`.`ProblemAccountId` = `c`.`ProblemAccountId`)))
    GROUP BY `p`.`ProblemId`), `seencounts`
AS
(SELECT
      `p`.`ProblemId` AS `seen_problem_id`,
      COUNT(`p`.`ProblemId`) AS `seen_count`
    FROM (`problem` `p`
      JOIN `problem_account` `pa`
        ON ((`p`.`ProblemId` = `pa`.`ProblemId`)))
    GROUP BY `p`.`ProblemId`), `avgratings`
AS
(SELECT
      `p`.`ProblemId` AS `rating_problem_id`,
      AVG(`pa`.`Rate`) AS `rate`,
      COUNT(`p`.`ProblemId`) AS `rate_count`
    FROM (`problem` `p`
      JOIN `problem_account` `pa`
        ON ((`p`.`ProblemId` = `pa`.`ProblemId`)))
    GROUP BY `p`.`ProblemId`), `problemorder`
AS
(SELECT
      `p`.`ProblemId` AS `ProblemId`,
      DENSE_RANK() OVER (
      ORDER BY `p`.`ProblemCode` DESC) AS `RowNumber`
    FROM `problem` `p`), `topicnames`
AS
(SELECT
      `p`.`ProblemId` AS `topicnames_problem_id`,
      GROUP_CONCAT(`t`.`TopicName` SEPARATOR ', ') AS `TopicNames`
    FROM ((`problem` `p`
      LEFT JOIN `problem_topic` `pt`
        ON ((`p`.`ProblemId` = `pt`.`ProblemId`)))
      LEFT JOIN `topic` `t`
        ON ((`pt`.`TopicId` = `t`.`TopicId`)))
    GROUP BY `p`.`ProblemId`)
SELECT
  `po`.`RowNumber` AS `RowNumber`,
  `p`.`ProblemId` AS `ProblemId`,
  `p`.`ProblemCode` AS `ProblemCode`,
  CONCAT(`p`.`ProblemCode`, '. ', `p`.`ProblemName`) AS `ProblemName`,
  `p`.`Difficulty` AS `Difficulty`,
  `p`.`State` AS `State`,
  `p`.`CreatedTime` AS `CreatedTime`,
  `p`.`CreatedBy` AS `CreatedBy`,
  `p`.`ModifiedBy` AS `ModifiedBy`,
  `p`.`ModifiedTime` AS `ModifiedTime`,
  `p`.`AccountId` AS `AccountId`,
  COALESCE(`rating`.`rate`, 0) AS `Rate`,
  COALESCE(`rating`.`rate_count`, 0) AS `RateCount`,
  COALESCE(`comment`.`comment_count`, 0) AS `CommentCount`,
  COALESCE(`seen`.`seen_count`, 0) AS `SeenCount`,
  (((`rating`.`rate` * `rating`.`rate_count`) + (4 * `comment`.`comment_count`)) + (3 * `seen`.`seen_count`)) AS `ReactionScore`,
  `tp`.`TopicNames` AS `TopicNames`,
  `t`.`TopicId` AS `TopicId`,
  `t`.`TopicName` AS `TopicName`
FROM (((((((`problemorder` `po`
  JOIN `problem` `p`
    ON ((`po`.`ProblemId` = `p`.`ProblemId`)))
  LEFT JOIN `problem_topic` `pt`
    ON ((`p`.`ProblemId` = `pt`.`ProblemId`)))
  LEFT JOIN `topic` `t`
    ON ((`pt`.`TopicId` = `t`.`TopicId`)))
  LEFT JOIN `commentcounts` `comment`
    ON ((`p`.`ProblemId` = `comment`.`comment_problem_id`)))
  LEFT JOIN `seencounts` `seen`
    ON ((`p`.`ProblemId` = `seen`.`seen_problem_id`)))
  LEFT JOIN `avgratings` `rating`
    ON ((`p`.`ProblemId` = `rating`.`rating_problem_id`)))
  LEFT JOIN `topicnames` `tp`
    ON ((`p`.`ProblemId` = `tp`.`topicnames_problem_id`)))
ORDER BY `po`.`RowNumber`;

